import { StyleSheet, Text, View, Button } from "react-native";

export default function Stats({ navigation }) {
  return <View>Hello</View>;
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
